# # General functions

def make_folder(folder):
    try:
        os.mkdir(folder)
    except FileExistsError:
        pass


# Beep sounds for in lab notification
def beeps(N):
    duration = 300  # milliseconds
    freq = 1000  # Hz
    wait = 300  # milliseconds
    for _ in np.arange(N):
        winsound.Beep(freq, duration)
        sleep(wait/1000)


