# # Plot LL data

def plot_ll_result(ll_filepath=None):
    if ll_filepath == None:
        ll = puzzle["LL"].result
    else:
        try:
            ll = ds.load(ll_filepath)
        except:
            raise Exception("ll_filepath not a correct .ds file.")
            
    fig, ax = plt.subplots(1, 2, constrained_layout=True)
    values = ll.take_sum('pixel').raw.astype(float)- np.sum(ll.metadata['background'], axis=0)
    values /= np.amax(values, axis=1).reshape((-1, 1))
    ax[0].pcolormesh(ll.wl, ll.aom_voltage, values, shading='nearest')
    ax[1].plot(ll.aom_voltage, ll.take_sum('pixel').take_sum('wl').raw.astype(int) - np.sum(ll.metadata['background']), "o-")
    ax[0].set_ylabel('AOM Voltage (V)')
    ax[0].set_xlabel('Wavelength (nm)')
    ax[1].set_xlabel('AOM Voltage (V)')
    ax[1].set_ylabel('Integrated counts')
    plt.show()


